prefix ext: <https://modellen.kkg.kadaster.nl/def/imxgeo-ext#>

select
  (?typeGebouw as ?Klasse)
  (sum(?kerken) as ?Aantal)
  (if(?typeGebouw=?parent, ?child, ?parent) as ?Denominatie)
  (if(?typeGebouw=?parent, '', ?child) as ?Subdenominatie)
{
  {
    {
      select ?first ?typeGebouw ?denominatie (count(*) as ?kerken)  {
        {
          {
            {
              {
                # Extract the denominations (stored under property ‚Äòbrt:soortnaam‚Äô).  From looking at the data we know that there are at most 3 concatenated substrings in one denomination string.
                values (?typeGebouw) {
                  ( 'kerk' )
                  ( 'moskee' )
                  ( 'overig religieus gebouw' )
                  ( 'synagoge' )
                }
                ?gebouw
                  a imxgeo:Gebouw ;
                  ext:gebouwType ?typeGebouw;
                  ext:soortnaam ?denominatie.
                # Filter out a couple of rows where mosques are of type ‚ÄòtypeGebouw:kerk‚Äô.  Leaving these in would mess up the tree, since some children would have two parents (both ‚ÄòtypeGebouw:moskee‚Äô and ‚ÄòtypeGebouw:kerk‚Äô).
                filter(!(?typeGebouw="kerk" && (regex(?denominatie,'moskee','i') || regex(?denominatie,'boedd','i'))) && !(?typeGebouw="overig religieus gebouw" && (regex(?denominatie,'kerk','i'))))
                # Multiple values are separated by ampersands (‚Äò&‚Äô).
                bind(' & ' as ?and)
              }
              bind(if(strbefore(?denominatie,?and)='', ?denominatie, strbefore(?denominatie,?and)) as ?first)
              bind(strafter(?denominatie,?and) as ?rest1)
            }
            bind(if(strbefore(?rest1,?and)='', ?rest1, strbefore(?rest1,?and)) as ?second)
            bind(strafter(?rest1,?and) as ?rest2)
          }
          bind(if(strbefore(?rest2,?and)='', ?rest2, strbefore(?rest2,?and)) as ?third)
